import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";

const StudentLogin = () => <div>Student Login Page</div>;
const IndustryRegister = () => <div>Industry Register Page</div>;
const IndustryLogin = () => <div>Industry Login Page</div>;
const AdminLogin = () => <div>Admin Login Page</div>;
const StudentDashboard = () => <div>Student Dashboard</div>;
const IndustryDashboard = () => <div>Industry Dashboard</div>;
const AdminDashboard = () => <div>Admin Dashboard</div>;

function App() {
  return (
    <Routes>
      {/* Home */}
      <Route path="/" element={<Home />} />

      {/* Logins / Register */}
      <Route path="/student-login" element={<StudentLogin />} />
      <Route path="/industry-register" element={<IndustryRegister />} />
      <Route path="/industry-login" element={<IndustryLogin />} />
      <Route path="/admin-login" element={<AdminLogin />} />

      {/* Dashboards */}
      <Route path="/student-dashboard" element={<StudentDashboard />} />
      <Route path="/industry-dashboard" element={<IndustryDashboard />} />
      <Route path="/admin-dashboard" element={<AdminDashboard />} />
    </Routes>
  );
}

export default App;
